import React from 'react';
import './index'
import './App.css';

// Components
import { NavBar } from './Components/Navbar/NavBar';

// Styles 
import './App.css';

function App() {
  //To Do: add props -->
  let handleClick = () => console.log('Hiciste click!.');
  return (
    <div className="App">
      <header>
        <NavBar
        click={handleClick}
        />
      </header>
    </div>
  )
}

export default App;
